import React from 'react'
// import SearchBar from '../SearchBar/SearchBar'
import './NavBar.css'

const NavBar = (props) =>{
    return(
        <nav className="Navbar navbar navbar-expand-md navbar-dark bg-danger container-fluid">
        <h1 className="navbar-brand col-sm-3 mr-0 align-items-center">{props.title}</h1>
        </nav>
    );
}
export default NavBar
